import React from 'react'
import './Trade.css';
import TradingViewWidget from 'react-tradingview-widget';

export default function Trading() {

let symbol = 'BITSTAMP:BTCUSD'
let width = TradingViewWidget.width = '500px'
let heighty = TradingViewWidget.height = '500px'
let themey = TradingViewWidget.theme = 'Dark' ;
// let interval = TradingViewWidget.interval= "60" 
let indicators =  TradingViewWidget.studies = [ "Volume@tv-basicstudies",  "TripleEMA@tv-basicstudies",  "RSI@tv-basicstudies"]

console.log(Trading)
console.log(typeof Trading)
console.log(Trading.width)
console.log(indicators[0])

return (
<div className="charts">

<div className="Navbar">
<button type="submit">ETH</button>
  <a href="">Large Caps</a>

  <a href="#news">Medium Caps</a>
  <a href="#contact">Small Caps</a>
  <a href="#home">SHORTS VS LONGS</a>
  <a href="#news">CoinFarm</a>
  <a target="_blank" href="http://data.bitcoinity.org/markets/bidask_sum/7d/USD/coinbase?bp=5&bu=c&t=m"> Bids vs Sums</a>
  <a href="#contact">Big Picture</a>
  <a href="#contact">Trades</a>
</div >

<TradingViewWidget

    symbol={symbol}
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='D'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'   
/>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='W'
    studies={indicators}  

  />

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='M'
    studies={indicators}          
  />


<TradingViewWidget

    symbol="BITSTAMP:BTCUSD"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='3'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'   
/>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='15'
    studies={indicators}  

  />

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='45'
    studies={indicators}          
  />

</div>
)
}
